                "closed_at": null,
                "body": "I've been trying to run my_web_server.js and am finding that it doesn't display anything on my browser.  Postman also says that it couldn't get a response.  Here's my code:\r\n\r\n'''\r\nvar http = require('http');\r\n\r\nhttp.createServer(function (req, res) {\r\n  res.writeHead(200, {'Content-Type': 'text/plain'});\r\n  res.end('Hello Alexia\\n');\r\n}).listen(8080);\r\n\r\nconsole.log('Server running on port 8080.');\r\n'''\r\n\r\nAnd here's the command and output:\r\n\r\n'''\r\n$ node my_web_server.js \r\nServer running on port 8080.\r\n'''\r\n\r\nI am able to ping localhost and the output seems fine, which is why I'm confused.  Any ideas?  It may be a mac issue..."
