                "body": "Like some other individuals, I'm having problems with authentication.  I have replayed the tutorial multiple times to ensure that I followed the correct steps.\r\n\r\nIt may have to do with the nonce, but I doubt it.  This is the only [Twitter Community forum](https://twittercommunity.com/t/how-to-generate-an-oauth-nonce/1307) that I could find on the topic and the nonce I used was composed of 32 alpha-numeric characters like it sounds like it should be.\r\n\r\nI have had a Twitter account since 2012ish and just downloaded Chrome/Postman today for the project.\r\n\r\nThanks,\r\nAlexia"
