                "body": "Hi all,\r\n\r\nWhen I am trying to run a request using my Postman App, I keep getting an authentication error that I know has to do with the Nonce. In the tutorial, Rory fixes this problem by dropping a new 32 character Nonce out of thin air. When I try to do the same (or at least repeat the same four characters eight times in a row),  this does not fix the issue.  "
