                "closed_at": null,
                "body": "I have been stuck on this error code 32 from Postman for the past several hours. No luck after scouring the internet and working with two of my roommates who have completed this portion of the assignment. \r\n\r\nI follow the tutorial and submit a successful GET. This returns my one and only Tweet as of now. I then replace the \"URL Parameter Key\" with \"https://api.twitter.com/1.1/statuses/update.json\" and the GET to a POST. This returns error code 32 \"Could not authenticate you\". \r\n\r\nI have regenerated keys several times, refreshed the page several times, exited out of my browser entirely several times, and still no luck. \r\n\r\n![image](http://i.imgur.com/5oaBC15.png)"
