                "body": "This assignment is proving to be very error prone already for me. I have been trying to work through my Twitter authentication for an hour now with nothing but errors. Here is the situation:\r\n\r\nI am following Ierne up until 6:20 in the video when he pastes the 32 character \"nonce\" value into Twitter. This situation does not fix my error code. I have error code 215 \"Bad Authentication Data\". In the video Postman highlights his \"nonce\" value to show that is where the error lies, but I am not getting any fields highlighted for assistance by postman.\r\n\r\nI followed his actions up until this point, so my newly regenerated keys have proper read and write access and I am attempting to use the \"nonce\" value from the video of \"ABCDEFGHIJKLMNOPQRSTUVWXYZ123456\" which is 32 characters. Need some more pointers please.\r\n\r\n![image](http://i.imgur.com/wiErMtx.png)\r\n![image](http://i.imgur.com/iuoC9L8.png)"
